                        <li><NavLink to="/signup">Sign Up</NavLink></li>
                        <li><NavLink href="/signin">Sign In</NavLink></li>
                    </ul>
                    {/**
                ORRRRR
                    <ul class="header--signedin">
                        <li>Welcome, Joe Smith!</li>
                        <li><a href="sign-out.html">Sign Out</a></li>
                    </ul> */}
                </nav>
            </div>
        </header>
    )
}

